import React from "react";
import styled from "styled-components";


const BetTable = () => {

    const Grid = styled.div`
display: grid;
grid-template-columns: repeat(3, 1fr);
grid-template-rows: 1fr;
grid-column-gap: 0px;
grid-row-gap: 0px;
}


    `
    return (
        <h1>asd</h1>
    )
}

export default BetTable;
